import{newSpecPage}from"@stencil/core/testing";import{h}from"@stencil/core";import{PrestoAudio}from"../presto-audio";describe("presto-audio",(()=>{it("renders",(async()=>{const t=await newSpecPage({components:[PrestoAudio],html:"<presto-audio></presto-audio>"});expect(t.root).toMatchSnapshot()})),it("renders autoplay",(async()=>{const t=await newSpecPage({components:[PrestoAudio],template:()=>h("presto-audio",{autoplay:!0})});expect(t.root).toMatchSnapshot()})),it("renders src",(async()=>{const t=await newSpecPage({components:[PrestoAudio],template:()=>h("presto-audio",{autoplay:!1,src:"http://192.168.31.191:3000/wp-content/uploads/2021/11/bensound-ukulele.mp3"})});expect(t.root).toMatchSnapshot()})),it("renders preload",(async()=>{const t=await newSpecPage({components:[PrestoAudio],template:()=>h("presto-audio",{preload:"",src:"http://192.168.31.191:3000/wp-content/uploads/2021/11/bensound-ukulele.mp3"})});expect(t.root).toMatchSnapshot()})),it("renders poster",(async()=>{const t=await newSpecPage({components:[PrestoAudio],template:()=>h("presto-audio",{preload:"",poster:"",src:"http://192.168.31.191:3000/wp-content/uploads/2021/11/bensound-ukulele.mp3"})});expect(t.root).toMatchSnapshot()})),it("renders track",(async()=>{const t=await newSpecPage({components:[PrestoAudio],template:()=>h("presto-audio",{tracks:[{label:"audioLable",src:"http://bensound-ukulele.mp3",srcLang:"en"}]})});expect(t.root).toMatchSnapshot()}))}));